        public static byte CalcChecksum(byte[] buffer, int startPos, int endPos)
        {
            byte b = buffer[startPos];
            for (int i = startPos + 1; i <= endPos; i++)
            {
                b ^= buffer[i];
            }
            return b;
        }

        private static SortedList<int, ParamDef> paramDefs;

        public static ParamDef GetParamDefByConverterParameter(int converterParameter, int converterType)
        {
            return GetParamDefByID(PKParameter2ConverterParameter(converterParameter, converterType));
        }

        public static SortedList<int, ParamDef> ParamDefs
        {
            get
            {
                return paramDefs;
            }
        }

        public static int PKParameter2ConverterParameter(int pkParam, int converterType)
        {
            ParamDef paramDefByID = GetParamDefByID(pkParam);
            if (paramDefByID == null)
            {
                return 0;
            }
            return paramDefByID.ParameterNr2ConverterParameter(converterType);
        }

        public static ParamDef GetParamDefByID(int iID)
        {
            ParamDef result;
            try
            {
                result = paramDefs[iID];
            }
            catch
            {
                result = null;
            }
            return result;
        }

        public static int ConverterParameter2PKParameter(int converterParam, int converterType)
        {
            foreach (KeyValuePair<int, ParamDef> current in paramDefs)
            {
                if (current.Value.ParameterNr2ConverterParameter(converterType) == converterParam)
                {
                    return current.Value.ParamNr;
                }
            }
            return 0;
        }

